debugtemplates-radio-intro:
Sentence prefix to introduce mouse click modes. Followed by one of:
* {{msg-mw|Debugtemplates-radio-select}}
* {{msg-mw|Debugtemplates-radio-eval}}
* {{msg-mw|Debugtemplates-radio-descend}}

debugtemplates-radio-select:
Continuation of radio-intro sentence:
* {{msg-mw|Debugtemplates-radio-intro}}
giving the radio button label to indicate that a mouse click will do nothing.
{{Identical|Nothing}}

debugtemplates-radio-eval:
Continuation of radio-intro sentence:
* {{msg-mw|Debugtemplates-radio-intro}}
giving the radio button label to indicate that a mouse click will evaluate a template.
{{Identical|Evaluate}}

debugtemplates-radio-descend:
Continuation of radio-intro sentence:
* {{msg-mw|Debugtemplates-radio-intro}}
giving the radio button label to indicate that a mouse click will descend into a template.
